import { Route, Routes } from "react-router-dom"
import { Home } from "./pages/Home"
import { AboutUs } from "./pages/AboutUs"

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home/>}/>
      <Route path="/aboutus" element={<AboutUs/>}/>
      <Route path="/contactus" element={<ContactUs/>}/>
    </Routes>
  )
}

export default App;
